svg.script:
var cluesShown=1;
var pretty=0;
function clueShowHide() {
  if(cluesShown==0) {
    document.getElementById("clues").style.display="none";
    document.getElementById("ciphers").style.display="inline";
    cluesShown=1;
  }
  else {
    document.getElementById("clues").style.display="inline";
    document.getElementById("ciphers").style.display="none";
    cluesShown=0;
  }
}


function mouseyDown(layerToShow) {
  document.getElementById(layerToShow).style.display="inline";
}

function mouseyUp(layerToHide) {
  document.getElementById(layerToHide).style.display="none";
}

function prettify() {
  if(pretty==0) {
    document.getElementById("ciphers").style.display="none";
    document.getElementById("logo").style.display="inline";
    pretty=1;
  }
  else {
    document.getElementById("ciphers").style.display="inline";
    document.getElementById("logo").style.display="none";
    pretty=0;
  }
}
